package com.example.ktoe.models;import java.time.LocalDateTime;import java.util.Objects;public class Token {    private int tokenId;    private int sentenceId;    private int tokenOrder;    private String koreanToken;    private String englishToken;    private LocalDateTime createdAt;    private LocalDateTime updatedAt;    public Token() {    }    public Token(int tokenId, int sentenceId, int tokenOrder, String koreanToken, String englishToken, LocalDateTime createdAt, LocalDateTime updatedAt) {        this.tokenId = tokenId;        this.sentenceId = sentenceId;        this.tokenOrder = tokenOrder;        this.koreanToken = koreanToken;        this.englishToken = englishToken;        this.createdAt = createdAt;        this.updatedAt = updatedAt;    }    public int getTokenId() {        return tokenId;    }    public void setTokenId(int tokenId) {        this.tokenId = tokenId;    }    public int getSentenceId() {        return sentenceId;    }    public void setSentenceId(int sentenceId) {        this.sentenceId = sentenceId;    }    public int getTokenOrder() {        return tokenOrder;    }    public void setTokenOrder(int tokenOrder) {        this.tokenOrder = tokenOrder;    }    public String getKoreanToken() {        return koreanToken;    }    public void setKoreanToken(String koreanToken) {        this.koreanToken = koreanToken;    }    public String getEnglishToken() {        return englishToken;    }    public void setEnglishToken(String englishToken) {        this.englishToken = englishToken;    }    public LocalDateTime getCreatedAt() {        return createdAt;    }    public void setCreatedAt(LocalDateTime createdAt) {        this.createdAt = createdAt;    }    public LocalDateTime getUpdatedAt() {        return updatedAt;    }    public void setUpdatedAt(LocalDateTime updatedAt) {        this.updatedAt = updatedAt;    }    @Override    public String toString() {        return "Token{" +            "tokenId=" + tokenId +            ", sentenceId=" + sentenceId +            ", tokenOrder=" + tokenOrder +            ", koreanToken='" + koreanToken + '\'' +            ", englishToken='" + englishToken + '\'' +            ", createdAt=" + createdAt +            ", updatedAt=" + updatedAt +            '}';    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (o == null || getClass() != o.getClass()) return false;        Token token = (Token) o;        return tokenId == token.tokenId &&            sentenceId == token.sentenceId &&            tokenOrder == token.tokenOrder &&            Objects.equals(koreanToken, token.koreanToken) &&            Objects.equals(englishToken, token.englishToken) &&            Objects.equals(createdAt, token.createdAt) &&            Objects.equals(updatedAt, token.updatedAt);    }    @Override    public int hashCode() {        return Objects.hash(tokenId, sentenceId, tokenOrder, koreanToken, englishToken, createdAt, updatedAt);    }}